# https://leetcode.com/problems/is-subsequence/

class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        idx = 0
        for ch in t:
            if idx == len(s):
                break
            if ch == s[idx]:
                idx += 1

        return idx == len(s)
    
arr = [
    [
        "leeeeetcode",""
    ]
]
foo, bar = arr[-1]
sol = Solution()
res = sol.isSubsequence(foo, bar)
print(res)